sys_variable_value.value:
(function execute(inputs, outputs) {
    //To get intervals (batches) to fetch the data.
    if (gs.nil(inputs.serviceRecord)) {
        var count = parseInt(inputs.total_count);
        var interval = parseInt(inputs.row_count);
        var tempCount = 0;
        var inter = "";
        do {
            var start = tempCount;
            var end = tempCount + interval;
            tempCount += interval;
            if (end > count) {
                var tempSub = end - count;
                end -= tempSub;
            }
            inter = inter + ", " + start.toString() + "-" + end.toString();
        } while (tempCount < count);
        var intervals = inter.slice(1).trim();
        var intervalsArray = intervals.split(",");
        var batchCount = intervalsArray.length;
        outputs.interval_range = intervalsArray;
        if (count == 0)
            outputs.batch_count = 0;
        else
            outputs.batch_count = batchCount;
    } else {
        var gr = new GlideRecord("sn_sap_data_int_integration_service_job_tracker");
        gr.get(inputs.serviceRecord);
        var failedBatches = gr.getValue("u_failed_batches");
        if (!gs.nil(failedBatches)) {
            var intervalsArray = (Object.keys(JSON.parse(failedBatches)));
            outputs.interval_range = intervalsArray;
            outputs.batch_count = intervalsArray.length;
        }
    }
})(inputs, outputs);

